import React from 'react';

import { Switch, Route } from 'react-router-dom';

import './App.css';
import Slider from './components/slider';
import Footer from './components/footer';
import Navbar from './components/navbar';

function App() {
  return (
    <React.Fragment>
      <header>
        <Navbar />
      </header>

      <main>
        
        <Slider />
      </main>

      <footer>
        <Footer />
      </footer>
    </React.Fragment>
  );
}

export default App;
